import styled from "styled-components/native";
import { css } from "styled-components/native";
import { View } from "react-native";

const positionVariant = {
  top: "marginTop",
  left: "marginLeft",
  right: "marginRight",
  bottom: "marginBottom",
};

export const Spacer = styled.View`${(props) => `${positionVariant[props.position]}:${props.size}`}`
